import React from 'react';
import './sign-in-and-sing-up.styles.scss';
import SignIn from '../../components/sign-in/sign-in.component'
import SignUp from '../../components/sign-up/sign-up.component'

class SignInAndSignUpPage extends React.Component {
    render() {
        return (
            <div className='sign-in-and-sign-up'>
                <SignIn></SignIn>
                <SignUp></SignUp>
            </div>
        )
    }
    
    componentWillMount(){
        document.body.style.backgroundImage = `url(https://images.squarespace-cdn.com/content/v1/53b599ebe4b08a2784696956/1409618807073-0C8BKUGLE46ON8KO762W/ke17ZwdGBToddI8pDm48kAPwG8dcqzqtMqOEGbYTcAR7gQa3H78H3Y0txjaiv_0fDoOvxcdMmMKkDsyUqMSsMWxHk725yiiHCCLfrh8O1z4YTzHvnKhyp6Da-NYroOW3ZGjoBKy3azqku80C789l0hveExjbswnAj1UrRPScjfAhmLw28JbgisQB0wOsNxAbNeN_rZSB9DZ7P0_M4w7ecw/CEO_portrait_0001_3.jpg?format=2500w)`;
    }

    componentWillUnmount(){
        document.body.style.backgroundColor = null;
    }
}

export default SignInAndSignUpPage;
